import React from "react"
import {NavLink} from "react-router-dom";
import styled from 'styled-components';

function Navbar () {
    return (
      <StyledWrapper>
      <div className="nav-container">
      	<div clasName="nav">
      </div>
        		<div className="logo">

       					 <NavLink to="/">
        <img src={"../../assets/images/mentee___white--horizontal.png"} class="img-fluid"  class="ml-3" style={{width: "10rem", height: "3.9rem"}} alt="mentee logo">
							</img>
						</NavLink>

       			 </div>
        	</div>
      </StyledWrapper>
    )
  }


export default Navbar
const StyledWrapper = styled.div`
.logo{
a:hover{
	color:white;
	text-decoration:none;
	background-color:transparent;
}
}


.nav {
	padding: 1px;
    color:white;
	display: flex;
	position: fixed;
	top: 0;
	left:10%;
	width:100%;
	z-index: 1;
}

.nav a:hover {
  background-color: white;
  color: var(--lightGreen);
}

.nav a.active {
  color: var(--darkGreen);
}		
ul.nav li {
  display: inline;
  list-style-type: none;
  margin: 0;
}

ul.nav li a {

  font-weight: 200;
  text-decoration: none;
  padding: 13px;
  display: inline-block;
  font-size:14px;
  color:white;
}
a{
	color:white;
	text-decoration:none;
}
a:hover{
	color:white;
	text-decoration:none;
	background-color:white;
}
.content li {
  margin-bottom: 10px;
  color:white;
}
.nav-container{
background-color:white;
left:60%;
position:fixed;
}
`
